window.bookSummaryJSON = "<p>I want a girl I can't have. She's my tutor. My best friend's girlfriend. And my kryptonite. She also looks really good in my T-shirt.</p> <p>But she wants the golden boy, and I'm more of the villain type. Or at least I was.... Until I saw her smile for the first time.</p> <p>But the good guy she wants wouldn't lust after his friend's girlfriend. And the good guy she's with sure as hell shouldn't be sneaking around behind her back.</p> <p>So where the hell does that leave me?</p> <p>Previously titled<i> Please Don't Be in Love with Someone Else</i>.</p>"; 
